import React from 'react';
import {ScrollView, Text, View, Image, SafeAreaView} from 'react-native';
import { styles } from '../Style/style';

export default function Dicas({navigation}){
  <SafeAreaView style={{backgroundColor:'red'}}>
    <ScrollView style={styles.dicas}>
      <View style={{backgroundColor:'red'}}>
        <Image style={styles.dicasImg1} source={require("../../img/Logo1.png")}/>
        <Text style={styles.dicasText}>
          Investimentos para Iniciantes: um guia com estratégias para quem
          quer começar
        </Text>

        <Text
          style={styles.dicasText1}
        >{`\nO invenstidor iniciante costuma ter muitas dúvidas sobre como atingir sua saúde financeira. Aprenda como começar a investir com segurança para garantir rentabilidade.`}</Text>


      </View>
    </ScrollView>
  </SafeAreaView>  

}
